import React from 'react';

const ResetButton = ({ onReset }) => (
  <div style={{ marginTop: '10px', display: 'flex', justifyContent: 'center' }}>
    <button
      onClick={onReset}
      style={{ 
        padding: '5px 10px',
        backgroundColor: '#ff4444',
        color: 'white',
        border: '1px solid #cc0000',
        borderRadius: '4px',
        cursor: 'pointer'
      }}
    >
      Reset Grid
    </button>
  </div>
);

export default ResetButton;
